import math

def preHash(string):

    byteLen = 512

    byte = string.encode()
    bytes = ""
    for b in byte:
        bytes = bytes + str(b)

    newBytes = ""
    newByte = 0
    factor = 1
    
    if(len(bytes) < byteLen):
        for i in bytes:
            factor = factor + int(i)
        for i in bytes:
            newByte = int(i) * factor
            factor = factor + int(i)
            newBytes = newBytes + str(newByte)
        bytes = str(newBytes)
        while(len(bytes) < byteLen):
            for i in bytes:
                newByte = int(i) * factor
                #factor = factor + int(i)
                newBytes = newBytes + str(newByte)
            bytes = str(newBytes)
    else:
        sub = bytes[-513:-1]
        while(len(str(bytes)) > byteLen):
            bytes = int(bytes) // int(sub)

    bytes = str(bytes)
    sub = bytes[-513:-1]

    while(len(str(bytes)) > byteLen):
        bytes = int(bytes) // int(sub)

    bytes = str(bytes)

    while(len(bytes) < byteLen):
            if(len(bytes) < 9):
                if(len(bytes) == 1):
                    lastChar = int(bytes[-1])
                else:
                    lastChar = int(bytes[-2:-1])
                secLastChar = int(bytes[-1])
            else:
                lastChar = int(bytes[-5:-1])
                secLastChar = int(bytes[-9:-5])
            if(lastChar == 0):
                if(len(bytes) < 5):
                    lastChar = int(bytes[-1])
                else:
                    lastChar = int(bytes[0:4])
            if(secLastChar == 0):
                if(len(bytes) < 9):
                    secLastChar = int(bytes[-1])
                else:
                    secLastChar = int(bytes[4:8])
            newChar = lastChar + secLastChar
            bytes = bytes + str(newChar)

    while(len(bytes) > byteLen):
            lastChar = int(bytes[-3:-1])
            secLastChar = int(bytes[-5:-3])
            if(lastChar == 0):
                lastChar = int(bytes[0:2])
            if(secLastChar == 0):
                secLastChar = int(bytes[2:4])
            if(lastChar > secLastChar):
                newChar = lastChar - secLastChar
            else:
                newChar = secLastChar - lastChar
            byteSub = bytes[-4:-1][::-1]
            bytes = bytes[::-1]
            bytes = bytes.replace(str(byteSub), str(newChar), 1)
            bytes = bytes[::-1]

    blockCount = math.ceil(byteLen / 8)
    blocks = []
    index = 0
    counter = 1
    
    while(index < byteLen):
        blocks.append(bytes[index:counter * blockCount])
        index = index + blockCount
        counter = counter + 1

    return blocks

def compress(blocks):

    primzahlen = [23, 29, 31, 37, 41, 43, 47, 53]
    checksums = []
    
    c = 0

    for block in blocks:
        checksum = 0
        for i in block:
            checksum = checksum + int(i)
        if(checksum%2 == 0):
            checksum = math.ceil(checksum * math.sqrt(primzahlen[c]))
        c += 1
        checksums.append(checksum)

    factor = 1

    for e in checksums:
        for f in str(e):
            factor = factor + int(f)
        c = e * factor * factor
        if(len(str(c))<9):
            c = c + 100000000
        #print(factor)
        checksums[checksums.index(e)] = c

    dig = None

    for h in checksums:
        blockHex = '{:05x}'.format(h)
        if(dig == None):
            dig = "duke$" + str(blockHex)
        else:
            dig = dig + str(blockHex)

    return dig

def hash(string):
    pre = preHash(string)
    hash = compress(pre)
    while(not len(str(hash)) == 61):
        pre = preHash(hash)
        hash = compress(pre)
    return hash

